import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
import { border, textAlign } from "@mui/system";
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import '../signup/signup.css'
import { useThemeProps } from "@mui/material";


function RedBar() {
    return (
      <Box
        sx={{
          height: 3
        }}
      />
    );
  }

function Signup(props){
  const signIn=()=>{
    props.listenToSignUp()
  }

    return(


             <Box sx={{
              top: 166,
              left: 658,
              width: 400,
              height: 440,
              background: '#FFFFFF 0% 0% no-repeat padding-box',
              boxShadow: '0px 5px 15px #00000029',
              border: '1px solid #E4E4E4',
              opacity: 1,
              zIndex:4,
              display:'flex',
              flexDirection:'column',
              alignItems:'start'
                 }}>
                     <Box sx={{
                         position:'relative',
                         top: 5,

                         width: '40%',
                         height: 33,
                         textAlign: 'left',
                         font: 'normal normal medium 25px/33px Roboto',
                         letterSpacing: 0,
                         color: '#0A0102',
                         textTransform:'uppercase',
                         opacity: 1,
                         display:'flex',
                         flexDirection:'row',
                         justifyContent:'space-even'



                     }}><h2 className='signup'>SIGNUP</h2>
                        <h2 className='login' sx={{color:'grey'}} onClick={signIn}>LOGIN</h2>

                     </Box>
                     <Box
                        sx={{
                            display: "flex",
                            flexDirection: "column",
                            "& .MuiTextField-root": { width: "30ch" },
                            position:'relative',
                            left:35,
                            top:30
                        }}
                        >
                        <RedBar />
                        <TextField label={'Full-Name"'} id="margin-none"  helperText="enter full name"/>
                        <RedBar />
                        <TextField label={'Email Id'} id="margin-none"  helperText="enter email id"/>
                        <RedBar />
                        <TextField label={'Password'} id="margin-normal"  helperText="password"/>
                        <RedBar />
                        <TextField label={'Mobile Number'} id="margin-normal" helperText="mobile" />

                        <Button variant="contained"  style={{position:'relative',background: '#A03037 0% 0% no-repeat padding-box', width:270}}
                         >Signup</Button>



                     </Box>





             </Box>


    )

}
export default Signup
